import React from 'react';

class EmployeeLeft extends React.Component {
    render() {
        let { employees, count, onClickEmployee } = this.props;
        let employeeList = null;
        let pageLink = [];
        let PageSize = 5;
        let pageNo = Math.ceil(count / PageSize);

        if (!!employees) {
            console.log("count:" + count);
            employeeList = employees.map((employee) => (
                <p key={employee.EmployeeID}>
                    <a href='' onClick={() => onClickEmployee(employee.EmployeeID)}>
                        {employee.EmployeeNumber} {employee.FirstName} {employee.LastName}</a>
                </p>
            ));
            for (let i = 0; i < pageNo; i++) {
                pageLink.push(
                    <a href=''> {i + 1} </a>
                );
            }
        }
        return (
            <div>
                {employeeList}
                <div id='pg'><p>{pageLink}</p></div>
                
            </div>
        );
    }
}

export { EmployeeLeft }
